import './App.css';
import Home from './components/Home'
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        {/* Navbar */}
        <div className= "nav">
          <h1>szean.</h1>

        </div>

        <Routes>
          <Route path = "/" element = {<Home/>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
